import React, { Component } from 'react'
import {Link, Outlet} from 'react-router-dom'

export default class Tabs extends Component {
  render() {
    return (
      <>
      <nav>
        <ul>
           <li><Link to='/Events'>Events</Link></li>
            <li><Link to='/Add event'>Add event</Link></li>
        </ul>
      </nav>
      </>
    )
  }
}
